import React from 'react';
import ResumeTemplateHeader from './resume-template-header';
import ResumeTemplateSubHeader from './resume-template-sub-header';

const ResumeTemplate = ({ title, subHeaderTitle, info, date, children }) => (
    <div className="row education">
        <ResumeTemplateHeader title={title} />
        <div className="nine columns main-col">
            <div className="row item">
                <div className="twelve columns">
                    <ResumeTemplateSubHeader
                      title={subHeaderTitle}
                      info={info}
                      date={date}
                    />
                    {children}
                </div>
            </div>
        </div>
    </div>
);

export default ResumeTemplate;
